import React from 'react';
import { Fragment } from 'react';
{/*El contenido HTML siempre debe estar dentro de un <div> o un fragmento*/}
export const Componente = () => {
  return (
    
    <Fragment> {/*Todo el contenido HTML de un componente siempre debe ir dentro de un Fragmento.*/}
        <h2>Mi primer componente</h2>
        <ul>
          <li>Angular</li>
          <li>React</li>
          <li>Vue</li>
        </ul>
    </Fragment>
  )
}

export default Componente;
